import React from "react";
import PropTypes from "prop-types";
// css
import "./Videos.scss";
// video
import lamboVideo from "../../assets/videos/lambo_gift.mp4";

function Videos(props) {
  return (
    <main>
      <div className="video-container">
        {/* video controls overlay */}
        <div className="video-container__controls">
          {/* overlay timeline */}
          <div className="video-container__controls__timeline"></div>
          {/* controls */}
          <div className="controls">
            <buttons className="controls__play-pause">Play</buttons>
          </div>
        </div>
        {/* video itself */}
        <video>
          <source src={lamboVideo} type="video/mp4" />
        </video>
      </div>
    </main>
  );
}

Videos.propTypes = {};

export default Videos;
